import React, { createContext, useState, useEffect } from 'react'


const apiValue = createContext();

function AllData({children}) {
    const [api, setApi] = useState([]);
    useEffect(() => {
        axios.get("")
            .then((element) => {
            setApi(element.data)
        })
    },[]);
    return (
        <apiValue.Provider value={""}> 
            {children}
        </apiValue.Provider>
    )
}

export { AllData, apiValue }
